メーカー希望小売価格はメーカーカタログに基づいて掲載しています<BR><BR><BR><table width="400" cellspacing="1" cellpadding="10" border="0" bgcolor="#A4dE17" align="left">
 <tr>
  <td valign="top" align="left" bgcolor="#A3CE06" width="30%" style="font-size:10pt;padding-left:10px;"><font color="#ffffff"><b>商品名</b></font>  </td>
  <td valign="top" align="left" bgcolor="#ffffff" width="70%" style="font-size:10pt;padding-left:10px;">Zardoz/ザードス/ノットワックスポケットパック NOTwax Pocket Puck</td>
 </tr>
 <tr>
  <td valign="top" align="left" bgcolor="#A3CE06" style="font-size:10pt;padding-left:10px;"><font color="#ffffff"><b>詳細</b></font>  </td>
  <td valign="top" align="left" bgcolor="#ffffff" style="font-size:10pt; padding-left:10px; color: #000000;"><p>デュポン社製の純度１００％の液体フッ素です。ノットワックスは全ての雪温で使用可能ですが、特にウェットな雪で高い滑走性能を発揮します。持続力も大変高く、また滑走面を摩耗から長時間保護します。<BR>
      <BR>
      ホットワクシングとの相性も抜群で、純パラフィン素材のワックス（フッ素などが含有されていないワックス）をノットワクシング処理した後にホットワクシングし、スクレーピング後再度ノットワックスを塗布すると、それぞれを単独使用したケースよりも極めて良い性能を発揮します。<BR>
      <BR>
      使用方法は簡単です。同梱のフェルトにノットワックスを染み込ませ、ベースに塗布するだけです。<BR>
      <BR>
      仕様/容量　15g/プラスチックボトル　フェルト</p>
    </td>
 </tr>
 <tr>
  <td valign="top" align="left" bgcolor="#A3CE06" style="font-size:10pt;padding-left:10px;"><font color="#ffffff"><b>備考</b></font>  </td>
  <td valign="top" align="left" bgcolor="#ffffff" style="font-size:10pt;padding-left:10px;">
<font color="#EC6B76">※画面上と実物では多少色具合が異なって見える場合もございます。ご了承ください。</font><br><br>
