 <tr>
  <td valign="top" align="left" bgcolor="#A3CE06" width="30%" style="font-size:10pt;padding-left:10px;"><font color="#ffffff"><b>商品名</b></font>  </td>
  <td valign="top" align="left" bgcolor="#ffffff" width="70%" style="font-size:10pt;padding-left:10px;">Zardoz/ザードス/テフロンブレンドワックス HIGH FLUORO WAX</td>
 </tr>
 <tr>
  <td valign="top" align="left" bgcolor="#A3CE06" style="font-size:10pt;padding-left:10px;"><font color="#ffffff"><b>詳細</b></font>  </td>
  <td valign="top" align="left" bgcolor="#ffffff" style="font-size:10pt; padding-left:10px; color: #000000;"><p>ノットワックスに待望の固形タイプが登場！<BR>
    最良質の低温対応ブレンドのパラフィン＋純度１００％テフロンの「NOTwax」を、デュポン社による監修のもとに完全融合に成功しました。<br>
    生塗りでも使用できますが、ホットワクシングにてワクシングすることで、「NOTwax」成分はもちろんパラフィンもより深く吸着浸透させます。<br>
    ホットワクシングで熱を入れてもノットワックスは有毒ガスを発生しないテフロン（フッ素）ですので、超高配合でも安心してご使用いただけます。<br>
    そしてこの低価格。ポケットパックとの併用で異次元の滑走を体験してください。<BR>
      <BR>
      仕様/容量　60g</p>
    </td>
 </tr>
