シーズンイン前に、板やボードのエッジに付着した錆びや汚れを簡単に落とせる「エライザー」でエッジをキレイにし、「スーパーＺベースクリーナー」でベース全体の汚れを浮かびあがらせ「ペーパータオル」で拭き取ります。次に「ナイロンブラシ」の台座に「サンドペーパー」を巻きベース全体をサンディングで磨きます。再度クリーンアップを行った後、「フィニッシンググローブ」で磨きあげます。<br>
そして「ノットワックスポケットパック」をベース全体に塗布し、一晩以上ベースを上に向けておいて終了です。 <br>
